sympy.sympy.polys.polyclasses._convert:
def _convert(f, dom: Domain[Es]) -> DMP_Python[Es]:
    """Convert the ground domain of ``f``. """
    return f._new(dmp_convert(f._rep, f.lev, f.dom, dom), dom, f.lev)
